	private static void enviarConGMail(String destinatario, String asunto, MimeMultipart multipart) {
	    // Esto es lo que va delante de @gmail.com en tu cuenta de correo. Es el remitente tambi√©n.
	    String remitente = "metropagoap@gmail.com";  //Para la direcci√≥n nomcuenta@gmail.com

	    Properties props = System.getProperties();
	    props.put("mail.smtp.host", "smtp.gmail.com");  //El servidor SMTP de Google
	    props.put("mail.smtp.user", remitente);
	    props.put("mail.smtp.clave", "AB123456c");    //La clave de la cuenta
	    props.put("mail.smtp.auth", "true");    //Usar autenticaci√≥n mediante usuario y clave
	    props.put("mail.smtp.starttls.enable", "true"); //Para conectar de manera segura al servidor SMTP
	    props.put("mail.smtp.port", "587"); //El puerto SMTP seguro de Google

	    Session session = Session.getDefaultInstance(props);
	    MimeMessage message = new MimeMessage(session);

	    try {
	        message.setFrom(new InternetAddress(remitente));
	        //message.addRecipient(Message.RecipientType.TO, destinatario);   //Se podr√≠an a√±adir varios de la misma manera
	        message.addRecipients(Message.RecipientType.TO, destinatario);
	        message.setSubject(asunto);
	        //message.setText(cuerpo);
	        message.setContent(multipart);
	        Transport transport = session.getTransport("smtp");
	        transport.connect("smtp.gmail.com", remitente, "AB123456c");
	        transport.sendMessage(message, message.getAllRecipients());
	        transport.close();
	    }
	    catch (MessagingException me) {
	        me.printStackTrace();   //Si se produce un error
	    }
	}
	
	
